            />
          </div>
        </div>
        <div className="proyectos-cards">
          <div className="card">
            <Card
              img={Monos}
              description="Página web creada con el fin de informar sobre la vida e historia de los Monos.
              "
              lenguaje1={React}
              lenguaje2={Node}
              lenguaje3={Firebase}
              lenguaje4={Express}
              link="Ir a la página"
              github="Ir al Github"
            />
          </div>
        </div>
        <div className="proyectos-cards">
          <div className="card">
            <Card
              img={Monos}
              description="Página web creada con el fin de informar sobre la vida e historia de los Monos.
              "
              lenguaje1={Html}
              lenguaje2={Css}
              lenguaje3={Js}
              lenguaje4={Bootstrap}
              link="Ir a la página"
              github="Ir al Github"
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Proyectos;
